window.bookSummaryJSON = "<p>Fans have long wondered what happened to Ahsoka after she left the Jedi Order near the end of the Clone Wars and before she reappeared as the mysterious Rebel operative Fulcrum in <i>Rebels</i>. Finally her story will begin to be told. </p> <p>Following her experiences with the Jedi and the devastation of Order 66, Ahsoka is unsure she can be part of a larger whole ever again. But her desire to fight the evils of the Empire and protect those who need it will lead her right to Bail Organa - and the Rebel Alliance. </p>"; 
